function generateMeme(src, caption) {
	var deferred = $.Deferred();
	var img = document.createElement('img');
	img.src = src;
	img.onload = function () {
		img.onload = null;
		var comp = detectNewImage(this);
		var tok = produceTokens(caption);
		var meme = processMeme(this, comp, processWords(tok['hashtags'], tok['words']));
		deferred.resolve(meme);
		// img.src = meme;
		// appendImage(img);
	}
	img.onerror = function () {
		deferred.reject("process failure");
	}
	//console.log(produceTokens(img.caption));
	return deferred.promise();
}
function appendImage (img) {
	/* Insert your callback here? */	
	var canvas = document.createElement('canvas');
	canvas.width = canvas.height = 640;
	var context = canvas.getContext("2d");
	context.drawImage(img, 0, 0);
}

function cloneImg (image) {
	var img = document.createElement('img');
	img.src = image.src;
	return img;
}
function detectNewImage(image) {
	var comp = ccv.detect_objects({ "canvas" : ccv.grayscale(ccv.pre(image)),
									"cascade" : cascade,
									"interval" : 5,
									"min_neighbors" : 1 });
	return comp;
}
function ran_range(min, max) {
	return Math.floor(Math.random()*(max-min) + min);
}
