function processWords(hashtags, words) {
	var list = [];
	var num = ran_range(5, 8);
	for (x in hashtags) {
		if (list.length < num) list.push(prepend[ran_range(0, prepend.length)]+" "+hashtags[x]);
	}
	
	if (list.length < num) list.push(additional[ran_range(0, additional.length)]);
	for (var k = list.length; k < num && words.length > 0; ++k) {
		list.push(prepend[ran_range(0, prepend.length)]+" "+words.splice(ran_range(0, words.length), 1)[0]);
	}
	if (list.length < num) 	list.push(additional[ran_range(0, additional.length)]);
	for (var k = list.length; k < num; ++k) {
		list.push(prepend[ran_range(0, prepend.length)]+" "+additional[ran_range(0, additional.length)]);
	}
	var uniquelist = [];
	for (x in list) {
		if (uniquelist.indexOf(list[x]) != -1) continue;
		uniquelist.push(list[x]);
	}
	return uniquelist;
}
function brightestSpot(canvas, context) {
	var h = canvas.height, w = canvas.width;
	var x = 0, mx = 0;
	var d = context.getImageData(0, 0, w, h).data;
	for (var i = 0, n = d.length; i < n; i+=4) {
		var s = d[i] + d[i+1] + d[i+2];
		if (s>= 725) continue;
		if (s > mx) {
			x = i;
			mx = s;
		}
		else if (s == mx) {
			if (Math.random()>0.5) x = i;
		}
	}
	return Math.floor(x/4);
}
